import { w3cwebsocket as W3CWebSocket } from 'websocket';

const client = new W3CWebSocket('ws://127.0.0.1:8080/');

function App() {
    const [cacheItems, setCacheItems] = useState({});

    useEffect(() => {
        client.onopen = () => {
            console.log('WebSocket Client Connected');
        };
        client.onmessage = (message) => {
            const dataFromServer = JSON.parse(message.data);
            setCacheItems(dataFromServer);
        };
    }, []);

    const handleSetItem = (key, value) => {
        // Implement the logic to send a SET request to the server
    };

    const handleDeleteItem = (key) => {
        // Implement the logic to send a DELETE request to the server
    };

    return (
        <div>
            <h1>LRU Cache Items</h1>
            <ul>
                {Object.entries(cacheItems).map(([key, value]) => (
                    <li key={key}>
                        {key}: {value}
                        <button onClick={() => handleDeleteItem(key)}>Delete</button>
                    </li>
                ))}
            </ul>
            {/* Add form to set new items */}
            <form onSubmit={(e) => {
                e.preventDefault();
                const key = e.target.elements.key.value;
                const value = e.target.elements.value.value;
                handleSetItem(key, value);
            }}>
                <input type="text" name="key" placeholder="Key" required />
                <input type="text" name="value" placeholder="Value" required />
                <button type="submit">Set Item</button>
            </form>
        </div>
    );
}

export default App;
